    media = val/div
    if media >= 0 and media <= 0.5:
        random_list1 = random.sample(cluster_zero, 35)
        random_list2 = random.sample(cluster_one, 15)
        return random_list1 + random_list2

    elif media > 0.5 and media < 1:
        random_list1 = random.sample(cluster_one, 35)
        random_list2 = random.sample(cluster_zero, 15)
        return random_list1 + random_list2

    elif media > 1 and media <= 1.5:
        random_list1 = random.sample(cluster_one, 35)
        random_list2 = random.sample(cluster_two, 15)
        return random_list1 + random_list2

    elif media > 1.5 and media < 2:
        random_list1 = random.sample(cluster_two, 35)
        random_list2 = random.sample(cluster_one, 15)
        return random_list1 + random_list2

    elif media > 2 and media <= 2.5:
        random_list1 = random.sample(cluster_two, 35)
        random_list2 = random.sample(cluster_three, 15)
        return random_list1 + random_list2
    
    elif media > 2.5 and media <= 3:
        random_list1 = random.sample(cluster_three, 35)
        random_list2 = random.sample(cluster_two, 15)
    
    elif media == 1: 
        random_list1 = random.sample(cluster_one, 30)
        random_list2 = random.sample(cluster_zero, 10)
        random_list3 = random.sample(cluster_two, 10)
        return random_list1 + random_list2 + random_list3

    elif media == 2:
        random_list1 = random.sample(cluster_two, 30)
        random_list2 = random.sample(cluster_one, 10)
        random_list3 = random.sample(cluster_three, 10)
        return random_list1 + random_list2 + random_list3

